sys_variable_value.value:
(function execute(inputs, outputs) {
  var json_data = JSON.parse(inputs.string_data);
  var arr = json_data.data;
  var found = false;
  for(i=0; i< arr.length && !found; i++) {
    //Match the first export and stop the loop
    if(arr[i].id==inputs.ExportFileID && arr[i].attributes["solicitation-id"]==inputs.SolicitationID) {
        found = true;
    	outputs.filename=arr[i].attributes["file-attributes"].filename;
    }    
  }
  //outputs.docidarray = docIds.toString(); 
})(inputs, outputs);

